import { Facebook, Instagram, Pinterest, Twitter } from "@material-ui/icons";
import React from "react";
import styled from "styled-components";

const Container = styled.div`
  display: flex;
`;

const Left = styled.div`
  flex: 1;
`;
const Center = styled.div`
  flex: 1;
`;
const Right = styled.div`
  flex: 1;
`;

function Footer() {
  return (
    <Container>
      <Left>
        <Logo>ECOMMER</Logo>
        <Description>
          Lorem ipsum dolor sit amet consectetur adipisicing elit. Voluptatibus
          repudiandae porro aliquam aut? Laboriosam tempore enim, consectetur
          vel facilis officiis? Odio, magni consequatur repellendus voluptatem
          similique sunt vitae cupiditate nemo.
        </Description>
        <SocialContainer>
          <SocialIcon>
            <Facebook />
          </SocialIcon>
          <SocialIcon>
            <Instagram />
          </SocialIcon>
          <SocialIcon>
            <Twitter />
          </SocialIcon>
          <SocialIcon>
            <Pinterest />
          </SocialIcon>
        </SocialContainer>
      </Left>
      <Center></Center>
      <Right></Right>
    </Container>
  );
}

export default Footer;
